import Locationpopup from "./LocationPopup.js";
export default function App() {
   return (
      <div className="App container">
         <Locationpopup/>
         <header>
            <h1>Ethereum Transfer</h1>
         </header>
         <SendTransferForm />
      </div>
   );
}
